import React from "react";
import { ArticleHelper } from "../components/ArticleHelper";
import "../styles/App.css";

export default function Templates() {
  const templates = [
    {
      title: "ATS Resume (Markdown + DOCX)",
      subtitle: "A clean, modern resume template optimized for ATS parsing and human readability.",
      technologies: ["Markdown", "Pandoc", "Word"],
      links: {
        github: "https://github.com/Mccullahz/ats-resume-template",
      },
      slug: "ats-resume",
    },
    {
      title: "Bubbletea TUI Starter",
      subtitle: "A fully styled starter template for Bubbletea CLI apps with list, progress, and view routing.",
      technologies: ["Go", "Bubbletea", "Lipgloss"],
      links: {
        github: "https://github.com/Mccullahz/bubbletea-tui-starter",
      },
      slug: "bubbletea-tui-starter",
    },
  ];

  return (
    <main className="projects-page">
      <h1 style={{ fontSize: "2rem", marginBottom: "2rem" }}>Templates</h1>
      {templates.map((tmpl, idx) => (
        <div key={idx} className="project-entry" style={{ marginBottom: "2.5rem" }}>
          <ArticleHelper
            title={tmpl.title}
            subtitle={tmpl.subtitle}
            technologies={tmpl.technologies}
            links={tmpl.links}
	    slug={tmpl.slug}
          />
        </div>
      ))}
    </main>
  );
}
